  <>
  <h1 className="toptitle">My favourite Animes</h1>
  <animeCard
   imgsrc = {Animedata[0].imgsrc}
   sname = {Animedata[0].sname}
   genre = {Animedata[0].genre}
   link = {Animedata[0].link}
  />
   <animeCard
   imgsrc = {Animedata[0].imgsrc}
   sname = {Animedata[0].sname}
   genre = {Animedata[0].genre}
   link = {Animedata[0].link}
  />
    </>,
  document.getElementById('root')
);
